import React from "react";
import '../assets/styles/all.css';
import '../assets/styles/writing.css';

const Writing = () => {
    return(
        <>
            <form className="writing">
                <article className="m-5">
                    <h5>닉네임 :</h5>
                    닉네임 :<input type="text"></input>
                </article>
            </form>
        </>
    )
}

export default Writing;
